import React from 'react';
import Chart from './Chart.jsx';
const Tail = (props) => {
  return (
    <div className="w3-container w3-round-xlarge w3-light-gray tail" style={{}}>
      <div className="w3-padding w3-display-container" >
        <div className="w3-display-right" style={{ height: '100%', margin: '0', width: '4px' }} >
          {/* <Chart/> */}
          {/* <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-circle" style={{ margin: '0.5em', width: '40px' }} /> */}
        </div>
      </div>
      <div className="w3-container" style={{ width: '80%', marginTop: '1em' }}>
        <p className="w3-text-grey" style={{ fontSize: '100%', marginBottom: '0.2em' }} ><b>{props.name || "Tail Name"}</b></p>
      </div>
    </div>);
}

export default Tail;
